import {TextField} from "@mui/material";
import React from "react";
import {ChangeFilterValue} from "../types/methods.type";
import {FilterProperty} from "../types/searchFilters.type";
import {FormControl} from "./formControl.component";
import {DesktopDatePicker} from "@mui/x-date-pickers";
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';


const fc = (c:JSX.Element)=><FormControl>
    {c}
</FormControl>

function onChange(changeFilterValue:ChangeFilterValue){
    return (e:any)=>changeFilterValue(e?.target?.value);
}

export function FilterValueInput({filterProperty,filterValue, changeFilterValue}:{filterProperty:FilterProperty, filterValue:string|null, changeFilterValue:ChangeFilterValue}) {
    switch (filterProperty){
        case FilterProperty.name:
        case FilterProperty.owner:
            return fc(<TextField variant="standard" value={filterValue} onChange={onChange(changeFilterValue)}/>)
        case FilterProperty.views:
            return fc(<TextField variant="standard" value={filterValue} type='number' onChange={onChange(changeFilterValue)}/>)
        case FilterProperty.lastViewed:
            return <LocalizationProvider dateAdapter={AdapterDateFns}>{fc(<DesktopDatePicker
                inputFormat="MM/dd/yyyy"
                value={filterValue}
                onChange={onChange(changeFilterValue)}
                renderInput={(params) => <TextField {...params} />}
            />)}</LocalizationProvider>
        case FilterProperty.type:
            break;

    }
    return null;
}
